import React from "react";
import styled from "styled-components";
import { makeStyles } from "@material-ui/core/styles";
import { Grid, Paper } from "@material-ui/core";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import img01 from "../assets/pictures/CardImages/img01.jpg";

const gridStyles = makeStyles((theme) => ({
  cardsContainer: {
    paddingTop: theme.spacing(3)
  },
  April: {
    fontWeight: 500,
    paddingBottom: theme.spacing(3)
  },

  card1: {
    height: 500,
  },

  media1: {
    height: 250,
    backgroundImage: `url(${img01})`,
  },

  card1h: {
    fontFamily: 'Arimo',
    fontWeight: "bold",
    textAlign: "left",
  },

  card1p: {
    fontFamily: 'Arimo',
    textAlign: "left",
  },

  card2: {
    height: 500,
  },

  media2: {
    height: 250,
    backgroundImage: `url(${img01})`,
  },

  card2h: {
    fontFamily: 'Arimo',
    fontWeight: "bold",
    textAlign: "left",
  },

  card2p: {
    fontFamily: 'Arimo',
    textAlign: "left",
  }
}));

const DateCardsContainer1 = styled.div`
  width: 285px;
  height: 500px;
  display: flex;
  flex-direction: column;
  border-radius: 25px;
  box-shadow: 0 2px 7px 1px rgba(31, 31, 31, 0.2);
  background-color: #1d1f21;
`;

export function DateCards(props) {

  const classes = gridStyles();

    return (
      <Container maxWidth="lg" className={classes.cardsContainer}>
        <Typography variant="h4" className={classes.April}>
          April
        </Typography>
        <Grid container spacing={3}>
          <Grid item xs={12} sm={6} md={4}>
            <Card className={classes.card1}>
              <CardActionArea>
                <CardMedia 
                className={classes.media1}
                />
                <CardContent>
                  <Typography className={classes.card1h} gutterBottom variant="h5" component="h2">
                    Jordan 5 Retro Raging Bulls Red
                  </Typography>
                  <Typography className={classes.card1p} variant="body2" color="textSecondary" component="p">
                    The Air Jordan 5 Raging Bulls is a suede lover's dream, bringing back the same look
                    and feel from ther 2009 version. The upper is composed entirely out of red suede, celebrating
                    MJ's tenure with the Chicago Bulls.
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
          <Grid item xs={12} sm={6} md={4}>
          <Card className={classes.card2}>
              <CardActionArea>
                <CardMedia 
                className={classes.media2}
                />
                <CardContent>
                  <Typography className={classes.card2h} gutterBottom variant="h5" component="h2">
                    Jordan 5 Retro Raging Bulls Red
                  </Typography>
                  <Typography className={classes.card2p} variant="body2" color="textSecondary" component="p">
                    The Air Jordan 5 Raging Bulls is a suede lover's dream, bringing back the same look
                    and feel from ther 2009 version. The upper is composed entirely out of red suede, celebrating
                    MJ's tenure with the Chicago Bulls.
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
          <Grid item xs={12} sm={6} md={4}>
            
          </Grid>
        </Grid>
      </Container>
    );
}
